import React from "react";
// import ReactDOM from "react-dom";
import picture1 from "./images/First One.jpg"
import picture2 from "./images/Second One.jpg"
import picture3 from "./images/Third One.jpg"
import picture4 from "./images/Fourth One.jpg"
import picture5 from "./images/Fifth One.jpg"
import picture6 from "./images/Sixth One.jpg"
import picture7 from "./images/Seventh One.jpg"
import picture8 from "./images/Eight One.jpg"


const ImageComponent = () => {
    return(
        {picture1},
        {picture2},
        {picture3},
        {picture4},
        {picture5},
        {picture6},
        {picture7},
        {picture8}

    )
}


export default "Images"
